import React from "react";

export const Footer = () => {
    return (
         <AppBar sx={{ m: 0, p: 0, }} position="static">
      <Container sx={{ m: 0, p: 0 }} maxWidth="xl">
        <Toolbar sx={{ m: 0, p: 0 }}>
          <Box sx={{ m: 0, p: 0, display: { xs: "flex", md: "none" } }}>
            <IconButton
              size="large"
              onClick={(e) => setAnchorElNav(e.currentTarget)}
            >
              <MenuIcon />
            </IconButton>
            <Menu
              anchorEl={anchorElNav}
              anchorOrigin={{
                vertical: "bottom",
                horizontal: "left",
              }}
              keepMounted
              transformOrigin={{
                vertical: "top",
                horizontal: "left",
              }}
              open={Boolean(anchorElNav)}
              onClose={(e) => setAnchorElNav(null)}
              sx={{
                display: { xs: "block", md: "none" },
              }}
            >

              {pages.map((page) => (
                <MenuItem onClick={(e) => setAnchorElNav(null)}>
                  <Button justifyContent="center"
                key={md5(page.text)}
                onClick={(e) => setAnchorElNav(null)}
                sx={{
                  backgroundColor: Theme.palette.otherColor.light,
                  color: "#888",
                  "&:hover": {
                    backgroundColor: Theme.palette.otherColor.main,
                  },
                }}

                href={page.href}
              >
                {page.text}
              </Button>
                </MenuItem>
              ))}

            </Menu>
          </Box>
          <img src={file1} height={40} width={40} />
          <Typography
            variant="h5"
            noWrap
            component="a"
            href=""
            sx={{
              mr: 2,
              display: { xs: "flex", md: "none" },
              flexGrow: 1,
              fontFamily: "monospace",
              fontWeight: 700,
              letterSpacing: ".3rem",
              color: "inherit",
              textDecoration: "none",
            }}
          >
            Babai Market
          </Typography>

        </Toolbar>
      </Container>
    </AppBar>
    );
};

export default Footer;
